function reorderStates(startI=0,endI=435) {
	var totalEV = startI;

	var demwidth = 0;
	var swingwidth = 0;
	var demVote = 0;
	var repVote = 0;
	var botW = 48;
	var sideH = 96;
	var topW = 150;
	

	resultsArray.sort((a, b) => parseFloat(-1*a[baseData]) - parseFloat(-1*b[baseData]));

	for (var i=0;i<435;i++) {
		var cdData = resultsArray[i];
		
		var presyear = cdData[baseData]-demoAdd;
		var dperc = presyear/20+50;
		if (dperc>99){
			dperc=99;
		}
		else if (dperc < 1){
			dperc=1;
		}
		
		demVote += cdData['votes16']*(dperc);
		repVote += cdData['votes16']*(100.0-(dperc));
	}
	for (var i=startI;i<endI;i++) {
		var cdData = resultsArray[i];
		
		if (2==2) {
			totalEV += 1;
			
			var presyear = cdData[baseData]-demoAdd;

			
			
			var dprob = 1.0/(1.0+Math.pow(10.0,-1*presyear/eloDenom));
			if (dprob < .5) {
				document.getElementById(cdData['abbrev']).style.fill = "hsl(0,100%,"+(50+dprob*100)+"%)";
			}
			else {
				document.getElementById(cdData['abbrev']).style.fill = "hsl(240,100%,"+(50+(1-dprob)*100)+"%)";
			}
			
			
			
			newspan = document.getElementById('odistrict-'+cdData['abbrev']);
			
			newspan.style.right = 'auto';
			newspan.style.top = 'auto';
			newspan.style.left = 'auto';
			newspan.style.bottom = 'auto';
			newspan.style.width = 'calc(3 * var(--block-width) - 0px)';
			newspan.style.height = 'calc(3 * var(--block-width) - 0px)';
			
			
			extraspan = document.getElementById('edistrict-'+cdData['abbrev']);
			extraspan.style.right = 'auto';
			extraspan.style.top = 'auto';
			extraspan.style.left = 'auto';
			extraspan.style.bottom = 'auto';
			
			
			var predSpan = newspan.childNodes[0];

			if (dprob < .5) {
				predSpan.style.background = "hsl(0,100%,"+(50+dprob*100)+"%)";
				extraspan.style.background = "hsl(0,100%,"+(50+dprob*100)+"%)";
			}
			else {
				predSpan.style.background = "hsl(240,100%,"+(50+(1-dprob)*100)+"%)";
				extraspan.style.background = "hsl(240,100%,"+(50+(1-dprob)*100)+"%)";
			}
			
			if (totalEV - 1 >= botW + sideH + topW+sideH) {
				newspan.style.right = 'calc('+(totalEV-1-botW-sideH-topW-sideH)+' * var(--block-width) )';
				newspan.style.width = 'calc('+1+' * var(--block-width) - 1px)';
				newspan.style.borderWidth = '0px 0px 0px 1px';
				
				
				if (totalEV - 1 == botW+sideH+topW+sideH) {
					newspan.style.width = 'calc('+1+' * var(--block-width) - 2px)';
					newspan.style.borderWidth = '0px 1px 0px 1px';
				}
				extraspan.style.right = 'calc('+(totalEV-1-botW-sideH-topW-sideH)+' * var(--block-width) )';
				if (newspan.parentElement.id !='pres2016BR'){
					newspan.parentElement.removeChild(newspan);
					document.getElementById('pres2016BR').appendChild(newspan);
					extraspan.parentElement.removeChild(extraspan);
					document.getElementById('extra2016BR').appendChild(extraspan);
				}
				
				

				
			}
			else if (totalEV - 1 >= botW + sideH + topW && totalEV <= botW+sideH+topW+sideH) {
				newspan.style.top = 'calc('+(totalEV-1-botW-sideH-topW)+' * var(--block-width) )';
				newspan.style.height = 'calc('+1+' * var(--block-width) - 1px)';
				newspan.style.borderWidth = '0px 0px 1px 0px';
				if (totalEV == botW+sideH+topW+sideH) {
					newspan.style.height = 'calc('+1+' * var(--block-width) - 0px)';
					newspan.style.borderWidth = '0px 0px 0px 0px';
				}
				if (totalEV - 1 == botW+sideH+topW) {
					newspan.style.height = 'calc('+1+' * var(--block-width) - 2px)';
					newspan.style.borderWidth = '1px 0px 1px 0px';
				}
				extraspan.style.top = 'calc('+(totalEV-1-botW-sideH-topW)+' * var(--block-width) )';
				if (newspan.parentElement.id !='pres2016R'){
					newspan.parentElement.removeChild(newspan);
					document.getElementById('pres2016R').appendChild(newspan);
					extraspan.parentElement.removeChild(extraspan);
					document.getElementById('extra2016R').appendChild(extraspan);
				}
				
			}
			else if (totalEV - 1 >= botW + sideH && totalEV <= botW+sideH+topW) {
				newspan.style.left = 'calc('+(totalEV-1-botW-sideH)+' * var(--block-width) )';
				newspan.style.width = 'calc('+1+' * var(--block-width) - 1px)';
				newspan.style.borderWidth = '0px 1px 0px 0px';
				if (totalEV == botW+sideH+topW) {
					newspan.style.width = 'calc('+1+' * var(--block-width) - 0px)';
					newspan.style.borderWidth = '0px 0px 0px 0px';
				}
				if (totalEV - 1 == botW+sideH) {
					newspan.style.width = 'calc('+1+' * var(--block-width) - 2px)';
					newspan.style.borderWidth = '0px 1px 0px 1px';
				}
				extraspan.style.left = 'calc('+(totalEV-1-botW-sideH)+' * var(--block-width) )';
				if (newspan.parentElement.id !='pres2016T'){
					newspan.parentElement.removeChild(newspan);
					document.getElementById('pres2016T').appendChild(newspan);
					extraspan.parentElement.removeChild(extraspan);
					document.getElementById('extra2016T').appendChild(extraspan);
				}
				
			}
			else if (totalEV - 1 >= botW && totalEV <= botW+sideH) {
				newspan.style.top = 'calc('+(botW + sideH - totalEV)+' * var(--block-width) )';
				newspan.style.height = 'calc('+1+' * var(--block-width) - 1px)';
				newspan.style.borderWidth = '1px 0px 0px 0px';
				if (totalEV == botW+sideH) {
					newspan.style.height = 'calc('+1+' * var(--block-width) - 0px)';
					newspan.style.borderWidth = '0px 0px 0px 0px';
				}
				if (totalEV - 1 == botW) {
					newspan.style.height = 'calc('+1+' * var(--block-width) - 2px)';
					newspan.style.borderWidth = '1px 0px 1px 0px';
				}
				extraspan.style.top = 'calc('+(botW + sideH - totalEV)+' * var(--block-width) )';
				if (newspan.parentElement.id !='pres2016L'){
					newspan.parentElement.removeChild(newspan);
					document.getElementById('pres2016L').appendChild(newspan);
					extraspan.parentElement.removeChild(extraspan);
					document.getElementById('extra2016L').appendChild(extraspan);
				}
				
			}
			else if (totalEV <= botW) {
				newspan.style.left = 'calc('+(botW - totalEV)+' * var(--block-width) )';
				newspan.style.width = 'calc('+1+' * var(--block-width) - 1px)';
				newspan.style.borderWidth = '0px 0px 0px 1px';
				if (totalEV == botW) {
					newspan.style.width = 'calc('+1+' * var(--block-width) - 0px)';
					newspan.style.borderWidth = '0px 0px 0px 0px';
				}
				extraspan.style.left = 'calc('+(botW - totalEV)+' * var(--block-width) )';
				if (newspan.parentElement.id !='pres2016BL'){
					newspan.parentElement.removeChild(newspan);
					document.getElementById('pres2016BL').appendChild(newspan);
					extraspan.parentElement.removeChild(extraspan);
					document.getElementById('extra2016BL').appendChild(extraspan);
				}
				
			}
			

		}
	}
	

	var pvel = document.getElementById('popularVote');
	var demelo = 1000*(demVote-repVote)/(demVote+repVote)+10*nationalAdj;
	var dprob = 1.0/(1+Math.pow(10.0,-1*demelo/75));

	pvel.style.left = "calc( "+(50*demoAdd/250+50)+"% - 38px + "+(-40*demoAdd/250)+"px)";

	
	if (demelo>0) {
		pvel.style.color = "hsl(240,100%,"+(50+(1-dprob)*100)+"%)";
		if (demelo>30){
			pvel.style.background = "white";
		}
		else {
			pvel.style.background = "black";
		}
		
		pvel.textContent = 'D+'+parseInt(demelo)/10+'%';
		
	}
	else {
		pvel.style.color = "hsl(0,100%,"+(50+dprob*100)+"%)";
		if (demelo<-30){
			pvel.style.background = "white";
		}
		else {
			pvel.style.background = "black";
		}
		pvel.textContent = 'R+'+parseInt(-1*demelo)/10+'%';
	}
	computeWin();
	var demProb218 = 1.0/(1.0+Math.pow(10.0,10*adj218/75));
	document.getElementById('dwinp').textContent = Math.round(demProb218*100,1)+"%";
}


